Text:
@niceworkmyfriend   - you know what I find amusing isn't the fact that you bothered to make some ridiculous claim about getting a letter.  

what I find amusing is that you claimed your isp was going to sue you over copyright infringement and piracy of material they did not own nor have a legal right to pursue litigation over.  

Next time you want to scare folks, use the company that produced the film at the very least so that we all know you're not a complete n00b, just an asshole.
